	const [cart, setCart] = useState([]);
	const handleClick = (item) => {
		cart.push(item);
		console.log(cart);
	};
	return (
		<section>
			{ListProducts.map((item) => (
				<CardProduct key={item.id} item={item} handleClick={handleClick} />
			))}
		</section>
	);
};
export default ShopingCart;
